import React from 'react';
import Banner from '../../components/Banner/Banner';
import Collapse from '../../components/Collapse/Collapse';
import bannerImage from '../../assets/images/banner.png';

const APropos = () => {
  return (
    <main>
      <Banner title="À propos de nous" image={bannerImage} />
      <div className="about-content">
        <div className="collapses-container">
          <Collapse title="Fiabilité">
            <p>Les an nonces postees sur Kasa garantissent une fiabilite totale. Les photos sont conformes aux logements, et
            toutes les informations sont regulierement verifiees par nos equipes.</p>
          </Collapse>
          <Collapse title="Respect">
          <p>La bienveillance fa it partie des valeurs fondatrices de Kasa. Tout comportement discriminatoire ou de
            perturbation du voisinage entralnera une exclusion de notre plateforme.
          </p>
          </Collapse>
          <Collapse title="Service">
            <p>La bienveillance fait partie des valeurs fondatrices de Kasa. Tout comportement discriminatoire ou de
            perturbation du voisinage entralnera une exclusion de notre plateforme.</p>
          </Collapse>
          <Collapse title="Sécurité">
            <p>Choisir Kasa signifie...</p>
          </Collapse>
        </div>
      </div>
    </main>
  );
};

export default APropos;
